import React,{Component} from 'react';
  import './App.css';
  import Home from './Pages/Home';
  import Room from './Pages/Room';
  import Host from './Pages/Host';
  import Error from './Pages/Error';
  import Signin from './Pages/Sinin';
  import Signup from './Pages/Signup';
  import Roominfo from './Pages/Roominfo';
  import Afterlogin from './Pages/Afterlogin';
  import Profile from './Pages/profile';
  import orders from './Pages/orders';
  import HostSignup from './Pages/hostsignup';
  import HostSignin from './Pages/hostsignin';

  import {Route, Switch} from 'react-router-dom';

export default class App extends Component {
  constructor(){
    super();

    this.state={
      loggedinstatus:"not_logged_in",
      user:{}
    }
    this.handlelogstatus=this.handlelogstatus.bind(this);
    this.handlelogin=this.handlelogin.bind(this);
  }
  handlelogstatus(data){
    this.props.handlelogin(data);
  }
  handlelogin(data){
    this.setState({
      loggedinstatus:"logged_in",
      user:data
    });
  }

  render() {
    return (<>
      <Switch>
          <Route exact path="/" component={Home}/>
          <Route exact path="/room" component={Room}/>
          <Route exact path="/room/:slug" component={Roominfo}/>
          <Route exact path="/host" component={Host}/>
          <Route exact path="/signin" component={Signin}/>
          <Route exact path="/signup" 
          render={props => (
            <Signup {...props} loggedinstatus={this.state.loggedinstatus}
            handlelogstatus={this.handlelogstatus} handlelogin={this.handlelogin}/>
          )}/>
          <Route exact path="/myaccount" component={Afterlogin}/>
          <Route exact path="/profile" render={props => (<Profile {...props}/> 
          )}/>
          <Route exact path="/orders" component={orders}/>  
          <Route exact path="/hostsignup" component={HostSignup}/>  
          <Route exact path="/hostsignin" component={HostSignin}/>  
          <Route component={Error}/>
      </Switch>
      </>
    );
  }
}
